import './styles.scss'; // Import the SASS file

function MenuBar() {
    return (
        <div className="menu-bar">
            <button className="menu-button">
                Button 1
            </button>
            <button className="menu-button">
                Button 2
            </button>
            <button className="menu-button">
                Button 3
            </button>
        </div>
    );
}
export default MenuBar;
